import { Card, Form, Button, Container, Row, Col, Badge, Alert, Tab, ListGroup, Accordion, Modal } from 'react-bootstrap'

//ref to Todo.js -> ListsComponent
const ProjectsList = ({ InputLists, size, setList, setInputLists }) => {
    const addList = text => {
        const newList = [...InputLists, { name: text, tasks: [] }];
        setInputLists(newList);
    };
    if (InputLists == null) InputLists = []
    if (!Array.isArray(InputLists)) InputLists = []
    return (
        <Col sm={size}>
            <Row xs={1} md={2} className="g-4">
            {Array.from({ length: 4 }).map((_, idx) => (
                <Col>
                <Card >
                <Card.Body>
                    <Card.Title>Project Title</Card.Title>
                    <Card.Text>
                        Project Description
                    </Card.Text>
                    <Button variant="primary">Open</Button>
                </Card.Body>
                </Card>
                </Col>
            ))}
            </Row>
        </Col>
    );
}

const Home = ({ m_userName }) => {
    //read projcets of user
    return (
        <div >
        <div className="home">
            <h2>Hello, {m_userName}</h2>
        </div>
        <div className="center">
            <h3>My Projects</h3>
            <ListsComponent setInputLists={setInputLists} InputLists={null} size={4} setList={setList} ></ListsComponent>
        </div>
        </div>



      
    )}
export default Home
